                    { new Guid("c05aeb8b-c88a-4cbd-8315-6ea69700bd0a"), "", 4, "<p><b>love</b></p><p>Category: Noun</p><p>Spelling: ləv</p><p>Definitions:</p><ul><li>an intense feeling of deep affection</li><li>a great interest and pleasure in something</li><li>a person or thing that one loves</li><li>(in tennis, squash, and some other sports) a score of zero; nil</li></ul><p>Examples:</p><ul><li>babies fill parents with feelings of love</li><li>their love for their country</li><li>his love for football</li><li>we share a love of music</li><li>she was the love of his life</li><li>their two great loves are tobacco and whiskey</li><li>love fifteen</li><li>he was down two sets to love</li></ul><p>Category: Verb</p><p>Spelling: ləv</p><p>Definitions:</p><ul><li>feel deep affection for (someone)</li><li>like or enjoy very much</li></ul><p>Examples:</p><ul><li>he loved his sister dearly</li><li>there were four memorial pages set up by her friends in honor of Phoebe, saying how much they loved and missed her</li><li>I just love dancing</li><li>I'd love a cup of tea</li><li>I love this job</li><li>they love to play golf</li></ul>", "<p><b>arbol</b></p><p>Category: Noun</p><p>Spelling: </p><p>Definitions:</p><ul><li>Planta de tronco leñoso, grueso y elevado que se ramifica a cierta altura del suelo formando la copa</li><li>Cuadro descriptivo que representa de forma gráfica las relaciones que tienen los elementos de un conjunto o las variaciones de un fenómeno</li><li>Barra fija o giratoria que en una máquina sirve para soportar piezas rotativas o para transmitir fuerza motriz de unos órganos a otros</li><li>Barra o eje que se usa en posición vertical y sirve de apoyo a una estructura que se desarrolla alrededor del mismo, como el árbol de una escalera de caracol</li><li>Madero que junto con otros se coloca perpendicularmente a la quilla de una embarcación y está destinado a sujetar las velas</li><li>Eje del órgano (instrumento musical) que, movido a voluntad del ejecutante, 